m_OpenUSSFiles.m_UssPreview:
.page-root {
    width: 100%;
    height: 100%;
    justify-content: center;
    align-items: center;
    background-color: rgb(255, 255, 255);
}

.login-panel {
    width: 800px;
    height: 600px;
    padding: 40px;
    gap: 16px;
    background-color: rgb(238, 243, 251);
    border-radius: 12px;
    justify-content: center;
}

.login-title {
    font-size: 28px;
    unity-font-style: bold;
    color: rgb(44, 47, 51);
    margin-bottom: 24px;
}

TextField {
    width: 100%;
}

Toggle {
    margin-top: 8px;
}

Button {
    margin-top: 24px;
    height: 40px;
    background-color: rgb(13, 110, 253);
    color: white;
    border-radius: 6px;
}

Button:hover {
    background-color: rgb(11, 94, 215);
}

.result-message {
    margin-top: 16px;
    font-size: 16px;
}

.result-message.success {
    color: rgb(25, 135, 84);
}

.result-message.error {
    color: rgb(220, 53, 69);
}
